export const LoginForm = () =>
{
    const[FirstName,setFirstName]=useState("");
    const[LastName,setLastName]=useState("");
    const[Email,setEmail]=useState("");
    const[MobileNo,setMobileNo]=useState("");
    const[DOB,setDOB]=useState("");
    const[Address,setAddress]=useState("");

    return(
        <form>
            <div class="front-view">
             <div class="body">
            <label>FirstName</label>
            <input type="text" value={FirstName} onChange={(e)=>setFirstName(e.target.value)} placeholder="Enter your firstname"></input><br></br><br></br>
            <label>LastName</label>
            <input type="text" value={LastName} onChange={(e)=>setLastName(e.target.value)} placeholder="Enter your lastname"></input><br></br><br></br>
            <label>Email</label>
            <input type="text" value={Email} onChange={(e)=>setEmail(e.target.value)} placeholder="Enter your email"></input><br></br><br></br>
            <label>MobileNo</label>
            <input type="text" value={MobileNo} onChange={(e)=>setEmail(e.target.value)} placeholder="Enter your MobileNo"></input><br></br><br></br>
            <label>DOB</label>
            <input type="text" value={DOB} placeholder="Enter your DOB"></input><br></br><br></br>
            <label>Address</label>
            <input type="text" value={Address} placeholder="Enter your Address"></input><br></br>

             </div>
            </div>
            </form>
    )
}
